import React from 'react';
import { connect } from 'redux-bundler-react';

class LeaderBoardList extends React.Component{
    render(){
        const {drawDataStats} = this.props;
        return (
            
            <ul className="list-group">{drawDataStats}</ul>
        )
    }
}

export default connect(
    'selectDrawDataStats',
    LeaderBoardList
)
